import numpy as np
import cv2
import matplotlib.pyplot as plt
import time
from threading import Thread
from PIL import Image


def viewField(width, height):
    array = np.zeros((height, width, 3))
    return array


def line(imgarr, x1,x2, y1,y2, color):
    field = zip(range(y1,y2),range(x1,x2))
    for i in field:
        imarr[i] = color

class drawer:
    def __init__(self, instanceDrawing:bool):
        self.instanceDrawing = instanceDrawing
            
    def rectangle(self, field, p1, p2, color, width, fill=0):
        x1,y1 = p1
        x2, y2 = p2
        if fill:
            field[y1:y2, x1:x2] = color
        else:
            field[y1:y1+width, x1:x2] = color
            field[y2:y2+width, x1:x2] = color
            field[y1:y2, x1:x1+width] = color
            field[y1:y2, x2:x2+width] = color
            field[y2:y2+width, x2:x2+width] = color
    def circle(self, field, center, radius, color, width, percent=1,  fill=0):
        cx, cy = center
        while self.repeat:
            for seta in range(0, int(360*percent), 2):
                x = cx+int(np.math.cos((np.math.pi/180)*seta) * radius)
                y = cy+int(np.math.sin((np.math.pi/180)*seta) * radius)
                color = np.random.random_sample(3)*255
                self.field[y:y+width,x:x+width] = color
                if not self.instanceDrawing:
                    time.sleep(0.001)
                if not self.repeat:
                    break
            self.field = self.getfield.copy()
        

def prog():
    w, h = 800,600
    pin = drawer(0)
    pin.w, pin.h = w,h
    field = viewField(w,h)
    imgarray = cv2.imread('fafa')
    imgarray_resized = cv2.resize(imgarray, (1001,700))
    #field = cv2.cvtColor(imgarray_resized, cv2.COLOR_BGR2RGB)
    field = imgarray_resized

    pin.field = field
    pin.getfield= field
    pin.repeat = 1
    #color = np.random.random_sample(3)*255
    def GG():
        for i in range(50):
            if not pin.repeat:
                return
            color = np.random.random_sample(3)*255
            Thread(target=pin.circle, args=[field, (500,250), np.random.randint(400,800), color, np.random.randint(1,15), 1,1]).start()
            time.sleep(0.1)
    Thread(target=GG).start()
    #Thread(target=pin.rectangle, args=(field, (100,100), (300,200), (0.5,0.5,0), 2, 0)).start()
    while 1:
        cv2.imshow('walallla', pin.field)
        if cv2.waitKey(100) == ord('q'):
            pin.repeat=0
            break
    cv2.destroyAllWindows()

import multiprocessing

if __name__ == '__main__':
    for i in range(1):
        th = multiprocessing.Process(target = prog)
        th.start()
    





